import React from 'react';

const Nosotros = () => {
    return (
        <div className="contenedor-nosotros">   
            <div className="contenido">
                <h2> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce lobortis, massa a tincidunt interdum, leo ipsum viverra nunc, ut interdum magna diam sed tortor. Nulla vulputate non arcu at viverra. Etiam eget massa semper, ultrices velit nec, ultricies velit. Curabitur blandit nunc in congue porttitor. Curabitur ultricies odio scelerisque magna eleifend faucibus. Donec ac semper turpis. Donec condimentum fringilla erat, eget venenatis nulla hendrerit id. Pellentesque placerat elit quis lorem elementum, eget placerat est sollicitudin. Morbi a augue eu tellus tempus bibendum. Suspendisse eget lacus ex. Proin tincidunt, augue vitae dictum lobortis, elit felis pulvinar orci, eget consequat libero dui nec ante. Aliquam erat volutpat. In diam lacus, elementum nec faucibus quis, porta et nibh. Sed quis malesuada ante. Ut pretium placerat libero, a placerat ligula fringilla maximus. Donec elementum ultrices sagittis.

Curabitur vel pretium odio. Nullam nec mauris at eros venenatis gravida. Ut sed dictum ex, at feugiat lorem. Cras libero nibh, pulvinar quis tortor et, placerat finibus sem. Pellentesque vitae leo et dui mattis fermentum in nec magna. Sed commodo dui quis feugiat faucibus. Ut quis lorem leo. Integer feugiat eget urna vitae molestie. Sed luctus enim nibh, et gravida sem vehicula ac. Curabitur nibh purus, commodo vel neque eu, ultricies dignissim diam. Ut non gravida sapien, vel fermentum urna. Phasellus tincidunt placerat ligula, vitae consequat urna mollis sed. Cras ullamcorper ultrices vestibulum.

Mauris tempus lobortis risus. Nulla convallis varius augue, vel viverra magna interdum eget. Aliquam libero ipsum, gravida non molestie a, sagittis ut dui. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque sagittis venenatis posuere. Praesent eu dictum neque. In vel augue ante. Nam et eros semper, pretium elit sed, pretium ante. Quisque ultrices suscipit neque, non vestibulum eros egestas at. Vestibulum iaculis pretium mauris, at pulvinar leo ullamcorper non. Aenean sodales, velit eu suscipit aliquet, urna dolor maximus nulla, a laoreet urna justo nec sem.</h2>
            </div>
        </div>
    );
};

export default Nosotros;
